{c_label}Recyclage{/c}
Décompose des objets en matériaux d’artisanat.
{icon:lmb} sur l’enclume, puis {icon:lmb} sur l’objet que vous voulez recycler.
{c_warning}Attention : ceci détruira l’objet définitivement !{/c}

{c_gold}Portail de retour en ville{/c_gold}
Vous téléporte en ville. 
({HOTKEY}) pour l’utiliser.
